import React, {Component} from 'react'
import './Calculator.css'
import Button from '../components/Button'

export default class Calculator extends Component {
    render(){
        return (
            <div className= "calculator">
                <Button/>
                <Button/>
                <Button/>
                <Button/>
                <Button/>
                </div>

        )
    }
}
